import React from 'react';
import PropTypes from 'prop-types'

const Home = (props) => {
  return (
    <div id="home" style={props.backgroundStyle}></div>
  )
};

Home.propsTypes={
  backgroundStyle: PropTypes.object.isRequired
}

export default Home;
